/*
Configuration sheet:
Security
URLs
Avatars
*/

var config = module.exports = {};

//Token Secret for Server side
config.jwtTokenSecret = process.env.jwtTokenSecret || "myfancytokensecretfortestingpurposes";

//Token Secret for Communication Server
if(process.env.commServerToken){
  config.commServerToken = "Basic " + new Buffer(process.env.commServerToken).toString('base64');
}

//URL comm server
config.commServerUrl = process.env.commServerUrl;

//URL Semantic Repository
config.semanticRepoUrl = process.env.semanticRepoUrl;

if(process.env.enabledAdapters){
  config.enabledAdapters = process.env.enabledAdapters.split(' ');
} else {
  config.enabledAdapters = ["generic.adapter.vicinity.eu"];
}

//SMTP Configuration
config.smtpHost = process.env.smtpHost;
config.smtpUser = process.env.smtpUser;
config.smtpPassword = process.env.smtpPassword;
config.mailServer = process.env.mailServer;
config.approverMail = process.env.approverMail;

// Platform base href
config.baseHref = process.env.baseHref;

// Vicinity services dir
config.vicinityServicesDir = process.env.vicinityServicesDir;

// SSL certificates
config.cert = process.env.cert || "/etc/letsencrypt/live/development.bavenir.eu/fullchain.pem";
config.key = process.env.key || "/etc/letsencrypt/live/development.bavenir.eu/privkey.pem";

// Environment
config.env = process.env.env || "test";

// Logs files
config.technicalLog = process.env.technicalLog;
config.profilerLog = process.env.profilerLog;

// Timeouts ( if 0 -> no timeout is set)

config.commserverTimeoutMs = process.env.commserverTimeoutMs !== undefined ? Number(process.env.commserverTimeoutMs) : 10000;
config.semanticrepoTimeoutMs = process.env.semanticrepoTimeoutMs !== undefined ? Number(process.env.semanticrepoTimeoutMs) : 10000;

//Avatar Defaults
 config.avatarUser="data:image/png;base64,";

 config.avatarOrg="data:image/png;base64,";

 config.avatarItem="data:image/png;base64,";
